    constructor(props) {
        super(props)

        this.state = {
            data: [{ name: '123' }],
            fatched: false
        }
    }

    componentDidMount() {
        this.getDataFromApi()
    }


    getDataFromApi() {
        httpGet('connectionService/getConnections').then(
            (result) => {
                if (result) {
                    return this.setState({
                        data: result,
                        fatched: true
                    });
                }

            },
        )
    }

onLogin(){
